import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">Weather App</header>
      <div className="card-group">
        <div className="card">
          <div className="card-body">
            <h3>Weds</h3>
            <p>76</p>
          </div>
        </div>
        <div className="card">#2</div>
        <div className="card">#3</div>
      </div>
    </div>
  );
}

export default App;
